using namespace std;

vector<string> separate_paren_groups(string paren_string) {
    vector<string> result;
    string current_group;
    int balance = 0;

    for (char ch : paren_string) {
        if (isspace(ch)) {
            continue; // Ignore spaces
        }

        // Add the character to the current group
        current_group += ch;

        // Update balance
        if (ch == '(') {
