        } else if (ch == ')') {
            balance--;
        }

        // If balance is zero, we have a complete group
        if (balance == 0 && !current_group.empty()) {
            result.push_back(current_group);
            current_group.clear(); // Reset for the next group
        }
    }

    return result;
}


