                    max_depth = current_depth; // Update max depth
                }
            } else if (ch == ')') {
                current_depth--; // Decrease depth for ')'
            }
        }

        depths.push_back(max_depth); // Store the maximum depth for the group
    }

    return depths; // Return the vector of maximum depths
}


