int how_many_times(string str, string substring) {
    if (substring.empty()) {
        return 0; // If the substring is empty, return 0
    }

    int count = 0;
    size_t pos = 0;

    // Loop to find all occurrences of the substring
    while ((pos = str.find(substring, pos)) != string::npos) {
        count++;
        pos++; // Move to the next position to allow for overlapping matches
    }

    return count;
}


#undef NDEBUG
#include<assert.h>
int main(){
    assert (how_many_times("", "x") == 0);
    assert (how_many_times("xyxyxyx", "x") == 4);
     assert (how_many_times("cacacacac", "cac") == 4);
    assert (how_many_times("john doe", "john") == 1);
}

