string flip_case(string str) {
    for (char &c : str) { // Iterate through each character in the string
        if (islower(c)) {
            c = toupper(c); // Convert to uppercase if it's lowercase
        } else if (isupper(c)) {
            c = tolower(c); // Convert to lowercase if it's uppercase
        }
    }
    return str; // Return the modified string
}


