using namespace std;

vector<int> sort_third(vector<int> l) {
    // Create a vector to hold the values at indices divisible by 3
    vector<int> third_indices_values;

    // Collect values at indices divisible by 3
    for (size_t i = 0; i < l.size(); ++i) {
        if (i % 3 == 0) {
            third_indices_values.push_back(l[i]);
        }
    }

    // Sort the collected values
    sort(third_indices_values.begin(), third_indices_values.end());

    // Replace the original values at indices divisible by 3 with sorted values
    size_t sorted_index = 0;
    for (size_t i = 0; i < l.size(); ++i) {
        if (i % 3 == 0) {
            l[i] = third_indices_values[sorted_index++];
        }
    }

    return l;
}

