    for (i = 0; i * 3 < l; i++) {
        // reverse the cycling of elements in each group.
        string x = s.substr(i * 3, 3);
        if (x.length() == 3) x = x[x.length() - 1] + x.substr(0, 2);
        output = output + x;
    }
    return output;
}


