// Function to check if a number is prime
bool is_prime(int num) {
    if (num <= 1) return false; // 0 and 1 are not prime numbers
    for (int i = 2; i * i <= num; i++) {
        if (num % i == 0) return false; // Found a divisor, not prime
    }
    return true; // No divisors found, it's prime
}

// Function to return the n-th Fibonacci number that is also prime
int prime_fib(int n) {
    int a = 0, b = 1; // Starting Fibonacci numbers
    int count = 0; // Count of prime Fibonacci numbers
    int prime_fib_num = 0; // The n-th prime Fibonacci number

    while (count < n) {
        int next_fib = a + b; // Generate next Fibonacci number
        a = b; // Move to the next Fibonacci number
