bool triples_sum_to_zero(vector<int> l) {
    // Sort the vector
    sort(l.begin(), l.end());

    int n = l.size();

    // Iterate through the vector
    for (int i = 0; i < n - 2; i++) {
        // Skip duplicate elements to ensure distinct elements
        if (i > 0 && l[i] == l[i - 1]) continue;

        // Use two pointers to find the other two elements
        int left = i + 1;
        int right = n - 1;

        while (left < right) {
            int sum = l[i] + l[left] + l[right];
            if (sum == 0) {
                return true; // Found a triplet
            } else if (sum < 0) {
                left++;
            } else {
                right--;
            }
        }
    }

    return false; // No triplet found
}

