#include <unordered_set>
using namespace std;

bool pairs_sum_to_zero(vector<int> l) {
    unordered_set<int> seen; // Set to store the numbers we have seen

    for (int num : l) {
        // Check if the negation of the current number is in the set
        if (seen.find(-num) != seen.end()) {
            return true; // Found a pair that sums to zero
        }
        seen.insert(num); // Add the current number to the set
    }

    return false; // No pairs found that sum to zero
}

