#include <iostream>
#include <string>
using namespace std;

string change_base(int x, int base) {
    if (base < 2 || base >= 10) {
        return ""; // Base must be between 2 and 9
    }

    if (x == 0) {
        return "0"; // Special case for zero
    }

    string result = "";
    while (x > 0) {
        int remainder = x % base; // Get the remainder
        result = to_string(remainder) + result; // Prepend the remainder to the result
        x /= base; // Reduce x by dividing it by the base
    }

    return result; // Return the final result
}


#undef NDEBUG
