string encode_shift(string s) {
    // Returns encoded string by shifting every character by 5 in the alphabet.
    string out;
    for (char c : s) {
        if (isalpha(c)) { // Check if the character is an alphabet
            char base = islower(c) ? 'a' : 'A'; // Determine the base for lowercase or uppercase
            char shifted = (c - base + 5) % 26 + base; // Shift and wrap around
            out += shifted; // Append the shifted character to the output
        } else {
            out += c; // Non-alphabet characters are added unchanged
        }
    }
    return out;
}

string decode_shift(string s) {
    // Takes as input string encoded with encode_shift function. Returns decoded string.
    string out;
    for (char c : s) {
        if (isalpha(c)) { // Check if the character is an alphabet
            char base = islower(c) ? 'a' : 'A'; // Determine the base for lowercase or uppercase
            char shifted = (c - base - 5 + 26) % 26 + base; // Shift back and wrap around
            out += shifted; // Append the shifted character to the output
        } else {
            out += c; // Non-alphabet characters are added unchanged
        }
    }
    return out;
}


