int fib(int n) {
    if (n <= 0) return 0; // Fibonacci of 0 is 0
    if (n == 1) return 1; // Fibonacci of 1 is 1

    int a = 0; // F(0)
    int b = 1; // F(1)
    int c; // To store the next Fibonacci number

    for (int i = 2; i <= n; i++) {
        c = a + b; // F(n) = F(n-1) + F(n-2)
        a = b;     // Update F(n-2)
        b = c;     // Update F(n-1)
    }

    return b; // F(n) is now in b
}


