#include <bits/stdc++.h>

#include <iostream>
#include <string>
using namespace std;

bool correct_bracketing(string brackets) {
    int balance = 0; // This will keep track of the balance of brackets

    for (char ch : brackets) {
        if (ch == '<') {
            balance++; // Increment for an opening bracket
        } else if (ch == '>') {
            balance--; // Decrement for a closing bracket
        }

        // If balance goes negative, it means there's a closing bracket without a matching opening bracket
        if (balance < 0) {
            return false;
        }
    }

    // At the end, balance should be zero if all brackets are matched
    return balance == 0;
}


#undef NDEBUG
