#include <iostream>
#include <vector>
using namespace std;

bool is_palindrome(const vector<int>& q) {
    int n = q.size();
    for (int i = 0; i < n / 2; ++i) {
        if (q[i] != q[n - 1 - i]) {
            return false; // Not a palindrome
        }
    }
    return true; // Is a palindrome
}

bool will_it_fly(vector<int> q, int w) {
    // Check if the vector is a palindrome
    if (!is_palindrome(q)) {
        return false; // Not balanced
    }

    // Calculate the sum of the elements
    int sum = 0;
    for (int num : q) {
        sum += num;
    }

    // Check if the sum is less than or equal to the maximum weight
    return sum <= w;
}

