    // Get the floor and ceil values
    int lower = static_cast<int>(floor(num));
    int upper = static_cast<int>(ceil(num));

    // Calculate the distances to the two integers
    double distanceToLower = abs(num - lower);
    double distanceToUpper = abs(num - upper);

    // Determine which integer to return
    if (distanceToLower < distanceToUpper) {
        return lower; // Closer to lower
    } else if (distanceToUpper < distanceToLower) {
        return upper; // Closer to upper
    } else {
        // Equidistant case
        if (lower < 0) {
            return lower; // Round away from zero (towards lower)
        } else {
            return upper; // Round away from zero (towards upper)
        }
    }
}


