    double num = stod(value);

    // Get the floor and ceil values
    int lower = static_cast<int>(floor(num));
    int upper = static_cast<int>(ceil(num));

    // Check the distance to the lower and upper integers
    double distanceToLower = abs(num - lower);
    double distanceToUpper = abs(num - upper);

    // If the distances are equal, round away from zero
    if (distanceToLower == distanceToUpper) {
        if (num > 0) {
            return upper; // Round up for positive numbers
        } else {
            return lower; // Round down for negative numbers
        }
    }

    // Otherwise, return the closest integer
    return (distanceToLower < distanceToUpper) ? lower : upper;
}


