string rounded_avg(int n, int m) {
    // Check if n is greater than m
    if (n > m) {
        return "-1";
    }

    // Calculate the sum of integers from n to m
    int sum = 0;
    for (int i = n; i <= m; ++i) {
        sum += i;
    }

    // Calculate the number of integers from n to m
    int count = m - n + 1;

    // Calculate the average
    double average = static_cast<double>(sum) / count;

    // Round down to the nearest integer
    int rounded_average = static_cast<int>(floor(average));

    // Convert the rounded average to binary
    string binary = "";
    if (rounded_average == 0) {
        binary = "0";
    } else {
        while (rounded_average > 0) {
            binary = to_string(rounded_average % 2) + binary;
            rounded_average /= 2;
        }
    }

    return binary;
}


