#include <vector>
using namespace std;

vector<int> f(int n) {
    vector<int> result(n);

    for (int i = 1; i <= n; ++i) {
        if (i % 2 == 0) {
            // Calculate factorial for even index
            int factorial = 1;
            for (int j = 1; j <= i; ++j) {
                factorial *= j;
            }
            result[i - 1] = factorial; // Store in the vector (0-based index)
        } else {
            // Calculate sum from 1 to i for odd index
            result[i - 1] = (i * (i + 1)) / 2; // Sum of first i natural numbers
        }
    }

    return result;
}


