#include <queue>
#include <bits/stdc++.h>

#include <iostream>
#include <vector>
using namespace std;

bool move_one_ball(vector<int> arr) {
    if (arr.empty()) return true; // An empty vector is considered sorted.

    int dropCount = 0;
    int n = arr.size();

    // Loop through the array to count the number of drops
    for (int i = 0; i < n; i++) {
        if (arr[i] > arr[(i + 1) % n]) {
            dropCount++;
            // If we find more than one drop, return false
            if (dropCount > 1) {
                return false;
            }
        }
    }

    return true; // If we have 0 or 1 drop, it's possible to sort by right shifts
}

// Example usage

#undef NDEBUG
#include<assert.h>
int main(){
    assert (move_one_ball({3, 4, 5, 1, 2})==true);
    assert (move_one_ball({3, 5, 10, 1, 2})==true);
    assert (move_one_ball({4, 3, 1, 2})==false);
    assert (move_one_ball({3, 5, 4, 1, 2})==false);
    assert (move_one_ball({})==true);
}

