// Function to calculate the sum of digits of a number
int sum_of_digits(int num) {
    int sum = 0;
    bool is_negative = num < 0;
    num = abs(num); // Work with the absolute value for digit extraction

    // Extract digits and calculate the sum
    while (num > 0) {
        sum += num % 10;
        num /= 10;
    }

    // If the number was negative, subtract twice the first digit
    if (is_negative) {
        // Get the first digit
        int first_digit = abs(num);
        while (first_digit >= 10) {
            first_digit /= 10;
        }
        sum -= 2 * first_digit; // Adjust for the signed first digit
    }

    return sum;
}

// Function to count numbers with a sum of digits > 0
int count_nums(vector<int> n) {
    int count = 0;

    for (int num : n) {
        if (sum_of_digits(num) > 0) {
            count++;
        }
    }

    return count;
}

// Example usage

