int max_fill(vector<vector<int>> grid, int capacity) {
    int total_times = 0;

    // Iterate through each well (row in the grid)
    for (const auto& well : grid) {
        int units_of_water = 0;

        // Count the number of water units (1s) in the current well
        for (int water : well) {
            if (water == 1) {
                units_of_water++;
            }
        }

        // Calculate the number of times we need to lower the bucket for this well
        if (units_of_water > 0) {
            total_times += (units_of_water + capacity - 1) / capacity; // This is equivalent to ceil(units_of_water / capacity)
        }
    }

    return total_times;
}


