int max_fill(vector<vector<int>> grid, int capacity) {
    int total_times = 0;

    for (const auto& well : grid) {
        int units_of_water = 0;

        // Count the number of 1s in the current well (row)
        for (int water : well) {
            if (water == 1) {
                units_of_water++;
            }
        }

        // Calculate the number of times we need to lower the bucket for this well
        if (units_of_water > 0) {
            total_times += (units_of_water + capacity - 1) / capacity; // Ceiling division
        }
    }

    return total_times;
}


