string get_closest_vowel(string word) {
    // Define the vowels
    string vowels = "aeiouAEIOU";
    int n = word.length();

    // We need to find a vowel between two consonants
    char lastConsonant = '\0';
    char foundVowel = '\0';

    // Iterate from the end of the string
    for (int i = n - 1; i >= 0; --i) {
        char currentChar = word[i];

        // Check if the current character is a consonant
        if (isalpha(currentChar) && vowels.find(currentChar) == string::npos) {
            // If we have found a consonant after a vowel
            if (lastConsonant != '\0' && foundVowel != '\0') {
                return string(1, foundVowel); // Return the found vowel
            }
            // Update the last consonant
            lastConsonant = currentChar;
        } 
        // Check if the current character is a vowel
        else if (vowels.find(currentChar) != string::npos) {
            // If we have found a vowel, store it
            foundVowel = currentChar;
        }
    }

    // If no valid vowel was found between consonants, return empty string
    return "";
}

