string match_parens(vector<string> lst) {
    string s1 = lst[0];
    string s2 = lst[1];

    // Count parentheses for s1
    int open1 = 0, close1 = 0;
    for (char c : s1) {
        if (c == '(') open1++;
        else close1++;
    }

    // Count parentheses for s2
    int open2 = 0, close2 = 0;
    for (char c : s2) {
        if (c == '(') open2++;
        else close2++;
    }

    // Check if s1 + s2 can be balanced
    if (open1 >= close2 && open2 >= close1) {
        return "Yes";
    }

    return "No";
}


#undef NDEBUG
#include<assert.h>
int main(){
    assert (match_parens({"()(", ")"}) == "Yes");
    assert (match_parens({")", ")"}) == "No");
    assert (match_parens({"(()(())", "())())"}) == "No");
    assert (match_parens({")())", "(()()("}) == "Yes");
    assert (match_parens({"(())))", "(()())(("}) == "Yes");
    assert (match_parens({"()", "())"}) == "No");
    assert (match_parens({"(()(", "()))()"}) == "Yes");
    assert (match_parens({"((((", "((())"}) == "No");
    assert (match_parens({")(()", "(()("}) == "No");
    assert (match_parens({")(", ")("}) == "No");
    assert (match_parens({"(", ")"}) == "Yes");
    assert (match_parens({")", "("}) == "Yes" );
}

