    if (balance1 + balance2 == 0 && min_balance1 + balance2 >= 0) {
        return "Yes";
    }

    // Check if s2 + s1 is balanced
    if (balance2 + balance1 == 0 && min_balance2 + balance1 >= 0) {
        return "Yes";
    }

    return "No";
