vector<int> get_odd_collatz(int n) {
    vector<int> odd_numbers; // Vector to store odd numbers in the Collatz sequence

    // Generate the Collatz sequence
    while (n != 1) {
        // If the number is odd, add it to the vector
        if (n % 2 != 0) {
            odd_numbers.push_back(n);
        }
        // Apply the Collatz rules
        if (n % 2 == 0) {
            n = n / 2; // If even, divide by 2
        } else {
            n = 3 * n + 1; // If odd, multiply by 3 and add 1
        }
    }

    // Add 1 to the list since the sequence always ends with 1
    odd_numbers.push_back(1);

    // Sort the vector in increasing order
    sort(odd_numbers.begin(), odd_numbers.end());

    return odd_numbers; // Return the sorted vector of odd numbers
}

