bool is_sorted(vector<int> lst) {
    if (lst.empty() || lst.size() == 1) {
        return true; // An empty vector or a single element vector is sorted
    }

    unordered_map<int, int> count_map; // To count occurrences of each number

    for (size_t i = 0; i < lst.size(); ++i) {
        // Check for sorted order
        if (i > 0 && lst[i] < lst[i - 1]) {
            return false; // Not sorted
        }

        // Count occurrences
        count_map[lst[i]]++;
        if (count_map[lst[i]] > 2) {
            return false; // More than two occurrences
        }
    }

    return true; // If we pass both checks, the vector is sorted and valid
}


