#include <stdlib.h>
#include <algorithm>
#include <math.h>
#include <stdio.h>
#include <string>
#include <climits>
#include <cstring>
#include <cassert>
#include <bitset>
#include <functional>
#include <cmath>
#include <cstdlib>
#include <queue>
#include <bits/stdc++.h>

#include <iostream>
#include <vector>
#include <limits>

using namespace std;

vector<int> largest_smallest_integers(vector<int> lst) {
    int largest_negative = numeric_limits<int>::min(); // Initialize to the smallest possible integer
    int smallest_positive = numeric_limits<int>::max(); // Initialize to the largest possible integer

    bool found_negative = false;
    bool found_positive = false;

    for (int num : lst) {
        if (num < 0) {
            found_negative = true;
            if (num > largest_negative) {
                largest_negative = num; // Update largest negative
            }
        } else if (num > 0) {
            found_positive = true;
            if (num < smallest_positive) {
                smallest_positive = num; // Update smallest positive
            }
        }
    }

    // If no negative was found, set to 0
    if (!found_negative) {
        largest_negative = 0;
    }

    // If no positive was found, set to 0
    if (!found_positive) {
        smallest_positive = 0;
    }

    return {largest_negative, smallest_positive};
}

