using namespace std;

vector<int> bestPath;
vector<int> currentPath;
int N;

void dfs(vector<vector<int>>& grid, int x, int y, int k) {
    // If the current path length is equal to k, check if it's the best path
    if (currentPath.size() == k) {
        if (bestPath.empty() || currentPath < bestPath) {
            bestPath = currentPath; // Update the best path
        }
        return;
    }

    // Directions for moving up, down, left, right
    vector<pair<int, int>> directions = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};

    // Explore all possible directions
    for (auto& dir : directions) {
        int newX = x + dir.first;
        int newY = y + dir.second;

        // Check if the new position is within bounds
        if (newX >= 0 && newX < N && newY >= 0 && newY < N) {
            currentPath.push_back(grid[newX][newY]); // Add the new cell to the path
            dfs(grid, newX, newY, k); // Recur for the new cell
            currentPath.pop_back(); // Backtrack
        }
    }
}

vector<int> minPath(vector<vector<int>> grid, int k) {
    N = grid.size();
    bestPath.clear();
    currentPath.clear();

    // Start DFS from every cell in the grid
    for (int i = 0; i < N; ++i) {
        for (int j = 0; j < N; ++j) {
            currentPath.push_back(grid[i][j]); // Start path with the current cell
            dfs(grid, i, j, k); // Start DFS
            currentPath.pop_back(); // Backtrack
        }
    }

    return bestPath; // Return the best path found
}

