vector<int> minPath(vector<vector<int>> grid, int k) {
    vector<int> bestPath; // To store the best path found
    int n = grid.size();

    // Start DFS from each cell in the grid
    for (int i = 0; i < n; ++i) {
        for (int j = 0; j < n; ++j) {
            vector<int> currentPath; // To store the current path
            currentPath.push_back(grid[i][j]); // Start the path with the current cell
            dfs(grid, i, j, k, currentPath, bestPath); // Perform DFS
            currentPath.pop_back(); // Backtrack
        }
    }

    return bestPath; // Return the best path found
}


