string file_name_check(string file_name) {
    // Check for exactly one dot
    size_t dot_pos = file_name.find('.');
    if (dot_pos == string::npos || file_name.find('.', dot_pos + 1) != string::npos) {
        return "No";
    }

    // Split the file name into name and extension
    string name_part = file_name.substr(0, dot_pos);
    string ext_part = file_name.substr(dot_pos + 1);

    // Check if the name part is empty and starts with a letter
    if (name_part.empty() || !isalpha(name_part[0])) {
        return "No";
    }

    // Check for the valid extensions
    if (ext_part != "txt" && ext_part != "exe" && ext_part != "dll") {
        return "No";
    }

    // Count the number of digits in the file name
    int digit_count = 0;
    for (char c : file_name) {
        if (isdigit(c)) {
            digit_count++;
        }
    }

    // Check if there are more than three digits
    if (digit_count > 3) {
        return "No";
    }

    // If all checks passed, return "Yes"
    return "Yes";
}

