// Function to check if a number is prime
bool is_prime(int n) {
    if (n <= 1) return false; // 0 and 1 are not prime numbers
    for (int i = 2; i * i <= n; ++i) {
        if (n % i == 0) return false; // Found a divisor, not prime
    }
    return true; // No divisors found, it is prime
}

// Function to extract words with prime lengths from a sentence
string words_in_sentence(string sentence) {
    stringstream ss(sentence);
    string word;
    vector<string> prime_length_words;

    // Split the sentence into words
    while (ss >> word) {
        // Check if the length of the word is prime
        if (is_prime(word.length())) {
            prime_length_words.push_back(word);
        }
    }

    // Join the words with prime lengths into a single string
    string result;
    for (const string& w : prime_length_words) {
        if (!result.empty()) {
            result += " "; // Add space before the next word
        }
        result += w;
    }

    return result;
}

