long long double_the_difference(vector<float> lst) {
    long long sum = 0; // Initialize sum to 0

    for (float num : lst) {
        // Check if the number is a non-negative integer
        if (num >= 0 && floor(num) == num) {
            int intNum = static_cast<int>(num); // Convert to integer
            // Check if the number is odd
            if (intNum % 2 != 0) {
                sum += intNum * intNum; // Add the square of the odd number to the sum
            }
        }
    }

    return sum; // Return the total sum
}


