        int digit = num % 10; // Get the last digit
        if (digit % 2 == 0) {
            even_count++; // Increment even count
        } else {
            odd_count++; // Increment odd count
        }
        num /= 10; // Remove the last digit
    }

    // Return the counts in a vector
    return {even_count, odd_count};
}


