    if (x == a) {
        y = b;
        z = c;
    } else if (x == b) {
        y = a;
        z = c;
    } else {
        y = a;
        z = b;
    }

    // Check if it satisfies the Pythagorean theorem
    return (fabs(y * y + z * z - x * x) < 1e-6); // Using a small epsilon for floating-point comparison
}


