bool right_angle_triangle(float a, float b, float c) {
    // Sort the sides to identify the longest side
    float x = fmax(a, fmax(b, c)); // longest side
    float y, z;

    if (x == a) {
        y = b;
        z = c;
    } else if (x == b) {
        y = a;
        z = c;
    } else {
        y = a;
        z = b;
    }

    // Check if the Pythagorean theorem holds
    return (y * y + z * z) == (x * x);
}


