using namespace std;

int do_algebra(vector<string> operato, vector<int> operand) {
    if (operato.size() != operand.size() - 1) {
        throw invalid_argument("The length of operator vector must be one less than the operand vector.");
    }

    // Start with the first operand
    int result = operand[0];

    // Iterate through the operators and operands
    for (size_t i = 0; i < operato.size(); ++i) {
        string op = operato[i];
        int next_operand = operand[i + 1];

        if (op == "+") {
            result += next_operand;
        } else if (op == "-") {
            result -= next_operand;
        } else if (op == "*") {
            result *= next_operand;
        } else if (op == "//") {
            if (next_operand == 0) {
                throw invalid_argument("Division by zero is not allowed.");
            }
            result /= next_operand; // Floor division in C++ is done using /
        } else if (op == "**") {
            result = static_cast<int>(pow(result, next_operand)); // Exponentiation
        } else {
            throw invalid_argument("Invalid operator: " + op);
        }
    }

    return result;
}


