int do_algebra(vector<string> operato, vector<int> operand) {
    if (operato.size() + 1 != operand.size()) {
        throw invalid_argument("The length of operator vector must be one less than the length of operand vector.");
    }

    // First, handle multiplication, floor division, and exponentiation
    vector<int> temp_operand = operand;
    vector<string> temp_operator = operato;

    for (size_t i = 0; i < temp_operator.size(); ++i) {
        if (temp_operator[i] == "*" || temp_operator[i] == "//" || temp_operator[i] == "**") {
            int result = 0;
            if (temp_operator[i] == "*") {
                result = temp_operand[i] * temp_operand[i + 1];
            } else if (temp_operator[i] == "//") {
                if (temp_operand[i + 1] == 0) {
                    throw invalid_argument("Division by zero is not allowed.");
                }
                result = temp_operand[i] / temp_operand[i + 1];
            } else if (temp_operator[i] == "**") {
                result = pow(temp_operand[i], temp_operand[i + 1]);
            }

            // Replace the operands and operator
            temp_operand[i] = result;
            temp_operand.erase(temp_operand.begin() + i + 1);
            temp_operator.erase(temp_operator.begin() + i);
            i--; // Adjust index after removal
        }
    }

    // Now handle addition and subtraction
    int final_result = temp_operand[0];

    for (size_t i = 0; i < temp_operator.size(); ++i) {
        if (temp_operator[i] == "+") {
            final_result += temp_operand[i + 1];
        } else if (temp_operator[i] == "-") {
            final_result -= temp_operand[i + 1];
        }
    }

    return final_result;
}


