using namespace std;

// Function to count the number of 1s in the binary representation of an integer
int countOnes(int n) {
    int count = 0;
    while (n) {
        count += n & 1; // Increment count if the last bit is 1
        n >>= 1;        // Right shift to check the next bit
    }
    return count;
}

// Comparator function for sorting
bool customComparator(int a, int b) {
    int onesA = countOnes(a);
    int onesB = countOnes(b);

    // First compare by number of ones
    if (onesA != onesB) {
        return onesA < onesB; // Sort by number of ones
    }
    // If the number of ones is the same, sort by the value itself
    return a < b; // Sort by value
}

// Main sorting function
vector<int> sort_array(vector<int> arr) {
    sort(arr.begin(), arr.end(), customComparator);
    return arr;
}

